import React from "react";

export const CategoryCard = ({ category }) => {
  return (
    <div className="flex flex-col justify-between items-center gap- group">
      <div className="rounded-full aspect-square w-32 overflow-hidden ">
        <img
          src={category.img}
          className="h-fullobject-cover scale-150 group-hover:scale-[2]"
          alt=""
        />
      </div>
      <span>{category.name}</span>
    </div>
  );
};
